import Home from "./Home";
import About from "./About";
import Cats from "./Cats"
import "./Main.css"

function Main({page, selectPage}) {
    return (
        <main className="main">
            {page === "/" && <Home/>}
            {page === "/cats.html" && <Cats selectPage={selectPage}/>}
            {page === "/about.html" && <About/>}
        </main>
    );
}
export default Main;
